import './App.css';
import StrokedText from './StrokedText';
import MenuDiv from './MenuDiv'

function App() {

  let s = ""
  const length = 0.3
  for (let i = 0; i < 360; i+=5) {
    s = s + Math.sin(i/360*2*Math.PI)*length + "vw " + Math.cos(i/360*2*Math.PI)*length + "vw 0 black, "
  }
  console.log(s)

  return (
    <div style={{textAlign: "center"}}>
      <h1 className={"strokedText3"} style={{color: "white"}}>Test</h1>
    </div>
  );
}

export default App;
